CREATE TABLE IF NOT EXISTS `data`.`evac_routes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `lng` float(10,6) NOT NULL,
  `lat` float(10,6) NOT NULL,
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `route_id` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `sector_id` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `available` tinyint(1) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `latlong` (`lat`,`lng`),
  KEY `longlat` (`lng`,`lat`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=3001 ;

